import React, { useState, useEffect } from 'react';
// Material UI
import Fab from '@material-ui/core/Fab';

import Header from './components/Header.jsx';
import JournalEditor from './components/JournalEditor.jsx';
import JournalGrid from './components/JournalGrid.jsx';
import './App.css';

function App() {

  const [isEntryOpen, setIsEntryOpen] = useState(false);


  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div className="App">
      <header className="App-header">
        <Header message="Good Afternoon, Will"></Header>
      </header>
      <body>
        <JournalEditor handleClickOpen={handleClickOpen} handleClose={handleClose} ></JournalEditor>
        <JournalGrid />
        <Fab color="primary" aria-label="add">
          Add
        </Fab>
      </body>
    </div>
  );
}

export default App;
